script: |
  super -f text -I q9740.spq | sort > q9740.out

inputs:
  - name: q9740.spq
    data: |
      SELECT DISTINCT 39 FROM tab1 (FORMAT parquet) WHERE - - col2 * - col2 * - col1 + - + col2 - ( col0 ) BETWEEN col1 AND - 61 * + - 77 * col0;
  - name: tab1

outputs:
  - name: q9740.out
    data: |
      39
